import React from "react";
import Select from "react-select"
import Async from "react-select/src/Async";

class SelectBar extends React.Component {
    async autosuggest() {
        fetch("https://yutong-li.cognitiveservices.azure.com/bing/v7.0/suggestions", {
            headers: {
                'Ocp-Apim-Subscription-Key': 'a42b6d1b1fad47d7b33425d7eea2f04f'
            }
        }).then(res => res.json())
            .then()
    }

    render() {
        return (
            <Select placeholder="Enter keyword .." className="selectBar"/>
        );
    }
}

export default SelectBar;
